এবার নিচে **“দুধওয়ালা শিম্পাঞ্জি”** গল্পটি সম্পূর্ণ **বাংলা ভাষায় Java প্রম্পট আকারে** লেখা হলো — যেন প্রতিটি দৃশ্য আলাদা অবজেক্ট হিসেবে সংরক্ষিত থাকে এবং যেকোনো AI ভিডিও জেনারেটরে সহজে ব্যবহারযোগ্য হয়:

---
```java
public class DudhwalaShimpanjhi {
    public static void main(String[] args) {

        Scene scene1 = new Scene(
            "দৃশ্য ১: সকালবেলার রাস্তা",
            "একটি লাল-হলুদ ইউনিফর্ম পরা শিম্পাঞ্জি মাথায় ছোট ক্যাপ পরে আনন্দের সঙ্গে দুধভর্তি সাইকেল চালিয়ে যাচ্ছে কুয়াশা-ঢাকা নির্জন শহরের রাস্তায়। সাইকেলের ঘণ্টি বাজছে, পাখির কিচিরমিচির, কোমল সকালের আলো। ৩ডি কার্টুন স্টাইল।"
        );

        Scene scene2 = new Scene(
            "দৃশ্য ২: হরিণের বাড়ি",
            "একটি মানুষসদৃশ হরিণ চশমা পরে ও হাতে মগ নিয়ে ফুলে ঢাকা ঘরের দরজায় দাঁড়িয়ে আছে। শিম্পাঞ্জি তার হাতে টাটকা দুধের বোতল দিচ্ছে। দুজনই হাসছে। সকালের আলো, আনন্দময় পরিবেশ, ৩ডি কার্টুন স্টাইল।"
        );

        Scene scene3 = new Scene(
            "দৃশ্য ৩: খরগোশের বারান্দা",
            "মাথায় তোয়ালে জড়ানো মানুষসদৃশ খরগোশ দাঁত মাজছে, মুখে ফেনা, সে শিম্পাঞ্জি দুধওয়ালার সঙ্গে কথা বলছে। শিম্পাঞ্জির হাতে অতিরিক্ত দুধের বোতল। সবুজ বাগানঘেরা বারান্দা, উজ্জ্বল সকাল, ৩ডি কার্টুন লুক।"
        );

        Scene scene4 = new Scene(
            "দৃশ্য ৪: হাতির প্রাসাদ",
            "একটি বিশাল মানুষসদৃশ হাতি টুপি ও গাউন পরে তার দোতলা বাড়ির দরজায় দাঁড়িয়ে আছে। সে বলছে, ‘আজ গরম দুধ চাই।’ শিম্পাঞ্জি সেলাম দিচ্ছে। মজার মুখাবয়ব, কোমল ব্যাকগ্রাউন্ড, ৩ডি অ্যানিমেশন স্টাইল।"
        );

        Scene scene5 = new Scene(
            "দৃশ্য ৫: ডেলিভারি শেষ",
            "শিম্পাঞ্জি রাস্তার মোড়ে বসে আছে, তার দুধের ঝুড়ি ফাঁকা, সে ঘাম মুছছে ও শান্তভাবে হাসছে। পেছনে সূর্য উঠছে, পাখি উড়ছে, শান্ত কার্টুন শহরের ব্যাকগ্রাউন্ড। ৩ডি অ্যানিমেশন স্টাইল।"
        );

        Scene scene6 = new Scene(
            "দৃশ্য ৬: সমাপ্তি শট",
            "একটি বড় সিনেম্যাটিক শটে দেখা যাচ্ছে, কার্টুন বন-শহরের ওপরে সূর্য উঠছে, প্রাণীরা জেগে উঠছে, ছোট ঘরগুলোর জানালা আলোতে ঝলমল করছে। দূরে শিম্পাঞ্জি সাইকেল চালিয়ে চলে যাচ্ছে। আকাশে লেখা: ‘দুধওয়ালা শিম্পাঞ্জি – প্রতিদিন সকাল সকাল!’"
        );

        // সব দৃশ্য প্রিন্ট করা
        scene1.show();
        scene2.show();
        scene3.show();
        scene4.show();
        scene5.show();
        scene6.show();
    }
}

class Scene {
    String title;
    String description;

    Scene(String title, String description) {
        this.title = title;
        this.description = description;
    }

    void show() {
        System.out.println("\n--- " + title + " ---");
        System.out.println(description);
    }
}
```

